/**
 * ! 超时
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var smallestDistancePair = function (nums, k) {
  if (nums.length === 2) {
    return [Math.abs(nums[0] - nums[1])];
  }

  const results = [];
  for (let i = nums.length - 2; i >= 0; i--) {
    if (i === nums.length - 2) {
      results.push(Math.abs(nums[nums.length - 1] - nums[nums.length - 2]));
    } else {
      const backup = nums.slice(i, nums.length);
      for (let j = 1; j < backup.length; j++) results.push(Math.abs(backup[0] - backup[j]));
    }
  }

  return results.sort((a, b) => a - b)[k - 1];

};

